import React from "react";
import ReactDom from "react-dom";
import Jokes from "./component/Jokes"
import data from './data'

const App = () =>{
  const JokesData = data.map(items =>{
    return(
      <>
      items = {items.map(el =>{
        return (
          <Jokes 
            key = {el.id}
            quotes = {el.quotes} 
          />
        )
      })}
      </>
    )
  })
  return(
    <>
    {JokesData}
    </>
  )
}

ReactDom.render(<App />, document.getElementById('root'))
